        static int LengthOfLongestSubstring(string s)
        {
            if (string.IsNullOrEmpty(s))
                return 0;

            int _ = -1;
            int max = 0;

            int[] __ = new int[256];
            for (var i = 0; i < __.Length; i++)
                __[i] = -1;

            for (var i = 0; i < s.Length; i++)
            {
                if (__[s[i]] > _)
                    _ = __[s[i]];

                if (i - _ > max)
                    max = i - _;

                __[s[i]] = i;
            }

            return max;
        }

